                        <input type="number" ClassName='input' text='name' placeholder='height' />
                        <span> Weight</span>
                        <input type="number" ClassName='input' text='name' placeholder='weight' />
                    </form>
                    </ModalNewProd>
            </div>
        )
    }

}

export default ListProducts
